import React from 'react';

export default function Dashboard() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Gestión de Ganado Bovino</h1>
      <p>Bienvenido al sistema integral de gestión de tu granja.</p>
      <ul>
        <li>Agenda de actividades</li>
        <li>Inventario Bovino</li>
        <li>Galería de Gramíneas</li>
        <li>Inventario Físico</li>
      </ul>
    </div>
  );
}
